    password: asmazirDB.password,
    });
db.connect(err => {
  if (err) {
    console.log("not connected due to error: " + err);
  } else {
    console.log("connected ! connection id is " + conn.threadId);
  }
});
db.query = promisify(db.query);
export default db;

