import { Router } from 'express';
import db from '../../services/connectionAsmazirDB.js'
const router = Router();


router.post('/restoranuserinfo', async (req, res) => {
  try {
    const data = await db.query('SELECT place_id,name,login,password FROM restorans WHERE login="'+req.user.login+'"');
    if(data.length>0){
      return res.json({type: 'ok', name: data[0].login, role: "admin", place_id: data[0].place_id});
    }else{
      return res.status(200).send({ type: 'error',token: "", place_id: 0, msg: 'Ресторан табылмады' });
    }
  } catch (err) {
    return res
      .status(200)
      .send({ type: "error", msg: err.message });
  }
});

router.post('/order-accept', async (req, res) => {
  if(!req.body.order_id){
      return res
      .status(200)
      .send({ type: "error", msg: 'Заказ белгісіз' });
  }
  try {
    const restoranMenuList = await db.query('UPDATE orders SET `id`=1 WHERE id='+req.body.order_id);
    return res.status(200).send({type: "ok", msg: "Order accept", });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

router.post('/order-cancel', async (req, res) => {
  if(!req.body.order_id){
      return res
      .status(200)
      .send({ type: "error", msg: 'Заказ белгісіз' });
  }
  try {
    const restoranMenuList = await db.query('UPDATE orders SET `id`=2 WHERE id='+req.body.order_id);
    return res.status(200).send({type: "ok", msg: "Order accept", });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

router.post('/menu-list', async (req, res) => {
  try {
    const restoranMenuList = await db.query('SELECT id,`name`,description,price,restoran_id,`delete`,image as imageUrl FROM restoran_menu WHERE restoran_id="'+req.user.place_id+'" and `delete`=0;');
    return res.status(200).send({type: "ok", msg: "", restoranMenu: restoranMenuList });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message, restoranMenu: [] });
  }

});

router.post('/menu-add', async (req, res) => {
  if(!req.body.name){
      return res
      .status(200)
      .send({ type: "error", msg: 'Аты белгісіз' });
  }
  if(!req.body.description){
      return res
          .status(200)
          .send({ type: "error", msg: 'Сипаттамасы белгісіз' });
  }
  if(!req.body.price){
      return res
          .status(200)
          .send({ type: "error", msg: 'Бағасы белгісіз' });
  }

  try {
      let instFood = await db.query('INSERT INTO `restoran_menu` SET '+
      'name="'+req.body.name+'",'+
      'description="'+req.body.description+'",'+
      'price="'+req.body.price+'",'+
      'restoran_id="'+req.user.place_id+'",'+
      'image="'+req.body.image+'"');
      return res.status(200).send({ type: "ok", msg: 'Тағам қосылды' });
  } catch (err) {
  return res
      .status(401)
      .send({ type: "error", msg: err.message } );
  }
});

router.post('/menu-delete', async (req, res) => {
  if(!req.body.menu_id){
      return res
       .status(200)
      .send({ type: "error", msg: 'Id белгісіз' });
  }
  try {
      let deleteMenu = await db.query('UPDATE restoran_menu SET `delete`=1 WHERE id='+req.body.menu_id);
      return res.status(200).send({ type: "ok", msg: 'Тағам өшірілді' });
  } catch (err) {
  return res
      .status(401)
      .send({ type: "error", msg: err.message } );
  }
});

router.post('/orders-list', async (req, res) => {
  try {
