import { Router } from 'express';
import jwt from 'jsonwebtoken';
const { secret } = require('../../config/vars');  
const router = Router();


router.post('/signin', async (req, res) => {
    if (req.body.password != "admin" || req.body.login !="admin") {
      return res.status(200).send({ type: 'error', msg: 'Не правильный пароль' });
    }else{
      const token = jwt.sign(
        {
         login: "admin"
        },
        secret,
        { expiresIn: '1d' },
      );
      return res.json({type: 'ok',token});
    }
});

router.post('/info', async (req, res) => {
  return res.status(200).send({ type: 'ok', name: "admin", role: "admin"});
});
router.post('/logout', async (req, res) => {
  return res.status(200).send({ type: 'ok'});
});



export default router;

