import { Router } from 'express';
import db from '../../services/connectionExamDB'
const router = Router();

router.post('/add', async (req, res) => {
  if(!req.body.question){
    return res
      .status(200)
      .send({ type: "error", msg: 'Заполните вопрос' });
  }
  try {
    //question
    await db.query('INSERT INTO `questions` SET '+
    'question="' +req.body.question+'"');
    return res.status(200).send({ type: "ok", msg: 'Ваш вопрос добавлен в базу' });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }
});

router.post('/list', async (req, res) => {
  try {
    const questions = await db.query('SELECT id,question FROM questions');
    return res.status(200).send({ type: "ok", questions: questions });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

router.post('/delete', async (req, res) => {
  try {
    if(!req.body.questionId){
      return res
        .status(200)
        .send({ type: "error", msg: 'Выберите вопрос' });
    }
    await db.query('DELETE FROM `questions` WHERE id="'+req.body.questionId+'"');
    await db.query('DELETE FROM `answers` WHERE questionid="'+req.body.questionId+'"');

    return res.status(200).send({ type: "ok", msg: '' });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

export default router;

