import { Router } from 'express';
import db from '../../services/connectionExamDB'
const router = Router();

router.post('/add', async (req, res) => {
  let trueAnswer = 0;
  if(!req.body.answer){
    return res
      .status(200)
      .send({ type: "error", msg: 'Заполните ответ' });
  }
  if(!req.body.questionId){
    return res
      .status(200)
      .send({ type: "error", msg: 'Выберите вопрос' });
  }
  if(req.body.trueAnswer){
    trueAnswer = req.body.trueAnswer;
  }

  try {
    //answer
    await db.query('INSERT INTO `answers` SET '+
    'answer="' +req.body.answer+'",'+
    '`true`='+trueAnswer+','+
    'questionid="' +req.body.questionId+'"');
    return res.status(200).send({ type: "ok", msg: 'Ваш ответ добавлен в базу' });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }
});

router.post('/list', async (req, res) => {
  if(!req.body.questionId){
    return res
      .status(200)
      .send({ type: "error", msg: 'Выберите вопрос' });
  }
  try {
    const question = await db.query('SELECT id,question FROM questions WHERE id = "'+req.body.questionId+'"');
    const answers = await db.query('SELECT id,answer,`true` FROM answers WHERE questionid = "'+req.body.questionId+'"');
    return res.status(200).send({ type: "ok", answers: answers, question: question[0].question });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});
router.post('/delete', async (req, res) => {
  try {
    if(!req.body.answerId){
      return res
        .status(200)
        .send({ type: "error", msg: 'Выберите ответ' });
    }
    await db.query('DELETE FROM `answers` WHERE id="'+req.body.answerId+'"');

    return res.status(200).send({ type: "ok", msg: '' });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

export default router;

