import { Router } from 'express';
import db from '../../services/connectionExamDB'
import _ from 'lodash';
const router = Router();
var moment = require('moment'); 

router.post('/add', async (req, res) => {
  if(!req.body.name){
    return res
      .status(200)
      .send({ type: "error", msg: 'Поле "Имя" не заполнено' });
  }
  if(!req.body.surname){
    return res
      .status(200)
      .send({ type: "error", msg: 'Поле "Фамилия" не заполнено' });
  }

  try {
    //student
    let instStudent = await db.query('INSERT INTO `results` SET '+
    'name="'+req.body.name+'",'+
    'surname="'+req.body.surname+'",'+
    'date="'+moment.utc(new Date()).format("YYYY-MM-DD HH:mm:ss")+'"');
    return res.status(200).send({ type: "ok",name: req.body.name,surname: req.body.surname, studentId: instStudent.insertId });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }
});

router.post('/question-list', async (req, res) => {

  try {
    const questions = await db.query('SELECT id,question FROM questions');
    const answers = await db.query('SELECT id,answer,questionid FROM answers ORDER BY questionid');
    const answerFilter  = async(questionId)=>{
      return _.filter(answers, function(a) { 
        return a.questionid == questionId; 
     });
    }
    let data = []
    for(let i=0; i<questions.length; i++){
      let ans = await answerFilter(questions[i].id)
      data.push({
        question: questions[i].question,
        questionId: questions[i].id,
        answers: ans
      })
    }
    return res.status(200).send({ type: "ok", questions: data });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

router.post('/save-result', async (req, res) => {
  if(!req.body.studentId){
    return res
      .status(200)
      .send({ type: "error", msg: 'Student is not find' });
  }
  if(!req.body.data){
    return res
      .status(200)
      .send({ type: "error", msg: 'Student is not find' });
  }


  /*
    [5,6,6]
  */
  try {
    const questions = await db.query('SELECT id,question FROM questions');
    const answers = await db.query('SELECT id,answer,`true`,questionid FROM answers ORDER BY questionid');
    const answerFilter  = async(answerId)=>{
      return _.filter(answers, function(a) { 
        return a.id == answerId; 
     });
    }
    let data = req.body.data;
    let trueAnswerCount = 0;
    for(let i=0; i<data.length; i++){
      let ans = await answerFilter(data[i])
      if(ans[0].true == 1){
        trueAnswerCount++
      }
    }
    let result = Math.ceil((trueAnswerCount * 100 )/questions.length)
    await db.query('UPDATE `results` SET result="'+result+'" where id=' + req.body.studentId);
    return res.status(200).send({ type: "ok", result: result });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "errors", msg: err.message});
  }

});


router.post('/results', async (req, res) => {
  try {
    const results = await db.query('SELECT id,name,surname,date,result FROM results');
    return res.status(200).send({ type: "ok", results: results });
  } catch (err) {
    return res
      .status(401)
      .send({ type: "error", msg: err.message});
  }

});

export default router;
